import React from 'react';
import './App.css';
import styled from 'styled-components';

const MainContainer = styled.div`
  margin: 0;
  padding: 0;
  display:flex;
  justify-content: center;
  height: 65vh;
`;

const EstiloDiv = styled.div`
  border: 1px solid black;
  margin: 1%;
  width: 384px;
  height: 100%;

`;


function App() {
  return (
    <div className="App">
      <MainContainer/>
      <EstiloDiv/>

    </div>
  );
}

export default App;
